import React from "react";

type TProps = {
    title: string
    description: string
}

const MainCompanyDescription: React.FC<TProps> = React.memo(({title, description}: TProps) => {
    return (
        <section>
            <div>{title}</div>
            <div>{description}</div>
        </section>
    )
})

export default MainCompanyDescription
